import "./App.css";
import { useState } from "react";

let data = [];

function App() {
  return (
    <div
      className="container"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100%",
      }}
    >
      <div
        className="carousel-container"
        style={{
          width: "600px",
          height: "200px",
          border: "1px solid",
          display: "flex",
        }}
      >
        <div
          className="item"
          style={{ display: "flex", flexDirection: "column" }}
        >
          <img
            src="./no-image.png"
            alt=""
            style={{ width: "200px", height: "120px" }}
          />
          <div class="info">
            <div className="name">Name</div>
            <div className="price">
              <span>price: </span>
              <span>$20</span>
            </div>
            <div className="category"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
